import React from 'react';
import {GoogleOutlined,FacebookOutlined} from '@ant-design/icons';
import "firebase/app";

import { auth } from '../firebase';
import { firestore } from 'firebase/app';

const Login = ()=>{
    return(
        <div id="login-page">
            <div id="login-card">
                <h2>Welcome to Bolchal!</h2>
                <div className = "login-button google" onClick = {()=> auth.signInWithRedirect(new firestore.auth.GoogleAuthProvider())}>
                    <GoogleOutlined/> Sign In With Google
                </div>
                <div className = "login-button facebook" onClick = {()=> auth.signInWithRedirect(new firestore.auth.FacebookAuthProvider())}>
                    <FacebookOutlined/> Sign In With Facebook
                </div>
            </div>
        </div>
    );
}
export default Login;
